●IPS方式で発色が鮮やか。自然な色合いを実現した31.5型ワイド液晶パネルのブラックです。<br>●上下178°、左右178°の広視野角を実現。どの角度から見ても鮮やかに映像を表示。<br>●スタンドは半円形のクレセントデザインによる｢アークラインスタンド｣を採用しました。 また、インテリアフィットを強く意識した高級感のあるデザインに仕上げました。<br>●解像度の低い画像などぼやけた映像を鮮明に再現する超解像技術を搭載。限りなく白浮きを軽減するシュートコントロール技術でより自然な描画を実現します。<br>●画面の明るさを調整すると発生していたフリッカー（ちらつき）を抑えて、目や脳への疲れを軽減します。<br>●非常に強いエネルギーを持ち、眼精疲労の原因と言われるブルーライトを抑え、目に負担の少ない紙に近い色温度で表示するピクチャーモードを搭載しています。<br>●映像の暗くて見づらい部分だけを自動判別し、暗い場所だけを明るく表示することができます。<br>●消費電力を低減するためにバックライトの明るさを抑える分、入力信号を増幅し、さらに液晶パネルの開口率をあげる技術によって、輝度の低下を低減します。<br>●色／ブラック<BR>●ディスプレイサイズ／31.5型ワイド<BR>●最大解像度／1920×1080<BR>●最大表示色／約1677万色<BR>●画素ピッチ／0.36375×0.36375mm<BR>●左右視野角／178°<BR>●上下視野角／178°<BR>●輝度／250cd/m2<BR>●コントラスト比／最大5000000：1（通常1200：1）<BR>●応答速度／5ms<BR>●水平周波数／30～83kHz<BR>●垂直周波数／アナログ：56～63Hz、HDMI：56～61Hz<BR>●映像入力端子／HDMI×1、D-Sub入力×1<BR>●出力端子／ヘッドホン（ステレオミニジャック）出力×1<br>●角度調整機能／前：-5°、後：10°<BR>●寸法／W727×D205×H492mm<BR>●重量／6.5kg<BR>●消費電力／通常：37W、電源OFF時・スリープモード：0.3W<BR>●電源／AC100～240V、50/60Hz<BR>●付属品／保証書、電源コード、ACアダプタ、HDMIケーブル、簡単セットアップガイド、D-Sub15Pinアナログケーブル、CD-ROM（取扱説明書/ソフトウェア収録）<BR>●保証期間／3年<br>※寸法、重量はスタンド使用時の値です。<br>●メーカー／ＬＧ<br>●型番／32MP58HQ-P<br>●JANコード／4989027010345<br><br>※メーカー都合によりパッケージ・仕様等が予告なく変更される場合がございます。ご了承ください。<br><br>本商品は自社サイトでも販売しているため、ご注文のタイミングにより、発送までにお時間をいただいたり、やむをえずキャンセルさせていただく場合がございます。<br><br>※沖縄へのお届けは別途1620円(税込)の送料がかかります。<p>お買い物マラソン等イベント開催中は、ご注文の集中により発送手続き、お問い合わせの回答にお時間をいただく場合がございます。ご了承ください。</p>

